interface IMasterChef2 {
  struct UserInfo {
    uint256 amount;
    uint256 rewardDebt;
    uint256 boostMultiplier;
  }

  struct PoolInfo {
    uint256 allocPoint;
    uint256 lastRewardBlock;
    uint256 accCakePerShare;
    bool isRegular;
  }

  // solhint-disable-next-line func-name-mixedcase
